import { useState } from 'react';

const CreatePruduct = () => {
  const [name, setName] = useState('Onur');
  return (
    <form>
      <label htmlFor="name">
        Name:
        <input
          type="text"
          id="name"
          name="name"
          placeholder="name"
          onChange={(e) => setName(e.target.value)}
          value={name}
        />
      </label>
    </form>
  );
};

export default CreatePruduct;
